 genocide.1.t:0 "Civilian Resent in [GetCurrentStateNameLoc]"
 genocide.1.d:0 "The civilian population has been angered by our active operation in [GetCurrentStateNameLoc], and the population has become more resistant to our occupation. This may require a crackdown if the resent grows or continues."
 genocide.2.t:0 "Fear in [GetCurrentStateNameLoc]"
 genocide.2.d:0 "The people of [GetCurrentStateNameLoc] have grown fearful of our active operation in the state. Resistance has decreased not as a result of what we have done, but out of fear of what more we could do."
 genocide.3.t:0 "Operation Complete in [GetCurrentStateNameLoc]"
 genocide.3.d:0 "The Operation in [GetCurrentStateNameLoc] has been completed, with an estimated [GetTempStatePopulationPositiveRoundedInText] Arrested and remnoved from the state."
 genocide.4.t:0 "Operation Complete in [GetCurrentStateNameLoc]"
 genocide.4.d:0 "The Operation in [GetCurrentStateNameLoc] has been completed, with Military Police removing an estimated [GetTempStatePopulationPositiveRoundedInText] from the state."
 genocide.5.t:0 "Operation Complete in [GetCurrentStateNameLoc]"
 genocide.5.d:0 "The Operation in [GetCurrentStateNameLoc] has been completed. Officers have executed an estimated [GetTempStatePopulationPositiveRoundedInText]. This war crime may not go unnoticed."
 genocide.6.t:0 "War Crimes in [GetGenocideCountryNewsName]"
 genocide.6.d:0 "Recent reports have been confirmed that [GetGenocideCountryNewsName] has killed thousands in recent genocides, causing civil unrest there and fear abroad. A body count could not be confirmed, but is suspected that potentially tens if not hundreds of thousands are now dead. The political ramifications of their actions are yet to be seen, but it is suspected that this will have grave consequences."
