 open_help_menu_button_tooltip:0 "Help Menu"
 help_general_button_tooltip:0 "General Info"
 help_general_geno_text:0 "Select what level of Removal you\nwant to use, then click the\nExecute Operation button.\nRed Text means you do not have\nthe required Equipment or\nPolitical Power, or you havn't\nselected a Removal Level."
 help_removal_button_tooltip:0 "Removal Info"
 help_removal_geno_text:0 "The Removal Level is how quickly\nthe operation is conducted.\nHigher Levels cost more, but are\nfaster.\nThe Removal Status shows\nhow many genocides have\nhappenedin the state, Green\nmeans none, Orange means 1, and\nRed means 2."
 help_cancel_button_tooltip:0 "Cancel Info"
 help_cancel_geno_text:0 "The Cancel Button can be used to\nstop it, no refunds, useful for\nif enemies capture the territory,\nor if something breaks."
 help_close_button_tooltip:0 "Closing Info"
 help_close_geno_text:0 "To conduct another operation in\nanother state, you have to close\nthe menu using the Close Button\nin the top right."
